/** @format */

import React, { Component } from "react";
import { getMovies } from "../services/fakeMovieService";
import { render } from "@testing-library/react";

class Movies extends Component {
  state = {};
  render() {
    return (
      <table className="table">
        <thead>
          <tr>
            <th>Title</th>
            <th>Genre</th>
            <th>Stock</th>
            <th>Rate</th>
          </tr>
        </thead>
      </table>
    );
  }
}

export default Movies;
